using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using LamestWebserver;
using LamestWebserver.UI;

namespace lwshostsvc
{
    public class HostServiceDefaultResponse : DirectoryElementResponse
    {
        /// <inheritdoc />
        public HostServiceDefaultResponse() : base("/")
        {
        }

        /// <inheritdoc />
        protected override HElement GetContent(SessionData sessionData, string subUrl)
        {
            PageBuilder pageBuilder = new PageBuilder("LamestWebserver Host Service");
            HContainer container = new HContainer() {Class = "main"};
            pageBuilder.AddElement(container);

            pageBuilder.StylesheetCode =
                "body{margin: 0;background: #ee6959;} ::selection{background: #fba680;color: #ffdac3;} img{margin: 1em auto 1em auto;display: block;max-width: 1110px; max-height: 350px;} div{font-size: 13pt;font-family: \"Segoe UI\", \"Tahoma\", \"Arial\", sans-serif;color: #222;line-height: 17pt;} div.main{width: 75%;background: #fff;margin: 0em auto 0em auto;display: block;padding: 2em 5em 8em 5em;} div.footer{margin-bottom: 10em;background-color: #333;width: 75%;margin: 0em auto 10em auto;padding: 2.5em 5em 2.5em 5em;color: #fff;} p,a,h1,h2,h3,div.container{max-width: 1100px; margin: 1em auto 0.5em auto;} a{color:#aaa;text-decoration: none; display:block;} a:hover{color:#ee6959;text-decoration: underline;} h1{font-family: \"Segoe UI Light\", Arial, sans-serif;font-weight: normal;font-size: 40pt;margin-bottom: 40pt;text-shadow: #d6d6d6 3px 3px 15px;} img.back{display: inline;margin: auto;width: 12px;margin-right: 4px;} h2 {font-family: \"Segoe UI\", Tahoma, Arial, Sans-serif;font-weight: lighter;margin-top: 2em;font-size: 22pt;color: #000;margin-bottom: 1em;display: block;border-bottom: #ee6959 1px solid;padding: 0.45em 0;} p.code{background: #fbfbfb;padding: 2.5em 3.5em;margin-top: 3em;margin-bottom: 3em;font-size: 11pt;color: #555;font-family: Consolas, \"Courier New\", monospace;} comment{color:#ccc;} marked{color:#ee6959;} h3{border-top: solid 1px #efefef;padding-top: 1em;margin -top: 2em;margin-bottom: -0.5em;color: #000;font-weight: normal;font-size: 15pt;font-family: \"Segoe UI Semibold\", \"Segoe UI\", Tahoma, sans-serif;}";

            switch (subUrl)
            {
                case "Tutorial":
                    container.AddElements(new HContainer
                    {
                        Class = "container",
                        Elements =
                        {
                            new HImage(
                                "data:image/png;base64,")
                            {
                                Class = "back"
                            },
                            new HLink("Back", "/") {Style = "display: inline;"}
                        }
                    });
                    container.AddElements(SetupTutorial(sessionData));
                    break;

                case "":
                default:
                    container.AddElements(MainPage(sessionData));
                    break;
            }

            pageBuilder.AddElement(new HContainer
            {
                Class = "footer",
                Elements =
                {
                    new HImage(
                        "data:image/png;base64,")
                    {
                        Style = "margin: 0 0 0 auto;"
                    }
                }
            });

            return pageBuilder;
        }

        private IEnumerable<HElement> MainPage(SessionData sessionData)
        {
            yield return new HImage("data:image/png;base64,");
            yield return new HNewLine();
            yield return new HText("No pages have been added to the LamestWebserver Host Service yet. This might take some time because every executable in your specified directories is being scanned for relevant Contents.");
            yield return new HText("If you haven't specified the directories yet or don't know what to do you can follow this tutorial:");
            yield return new HLink("How to use the Host Service?", "Tutorial");
        }

        private IEnumerable<HElement> SetupTutorial(SessionData sessionData)
        {
            yield return new HHeadline("How to use the Host Service?");
            yield return new HText("The LamestWebserver Host Service is a Windows Service that hosts applications developed with LamestWebserver of a specified directory (or multiple directories) and automatically updates the runtimes as soon as they're changed. So you can just compile while developing and the host service will automatically pick up the new version - all users will still be logged in and can continue using the service without even noticing the updating. You can also use this if you have a running application on a server which is in use to try and hot-swap all current users to the new version.");
            yield return new HHeadline("How to develop for the Host Service?", 2);
            yield return new HText("Developing for the Host Service - instead of a directly executable Application - requires at most minor additions to your code:");
            yield return new HText("The Host Service automatically scans one of a few specific directories (specified in the configuration file) for executable Applications and DLLs for pages that can be added to the HostService. In order to add them the response class has to be defined publicly and there has to be an empty constructor for this class.");
            yield return CodeElement("using System;\nusing LamestWebserver;\n\nnamespace Demos\n{\n\t<marked>public</marked> class DemoResponse : <marked>ElementResponse</marked> // Inheriting from a Type that is recognized as Page. \n\t{\n\t\t<marked>public DemoResponse()</marked> : base(\"/\")\n\t\t{\n\t\t\t// Parameterless Constructor.\n\t\t}\n\n\t\tprotected override HElement getElement(SessionData sessionData)\n\t\t{\n\t\t\treturn new HText(\"Hello World!\");\n\t\t}\n\t}\n}");
            yield return new HText("If you don't want a Page with an empty constructor to be added automatically add the Attribute LamestWebserver.Attributes.IgnoreDiscovery to your class.");
            yield return CodeElement("using System;\nusing LamestWebserver;\n\nnamespace Demos\n{\n\t[<marked>Attributes.IgnoreDiscovery</marked>] // This class will be ignored on discovery.\n\tpublic class DemoResponse2 : ElementResponse\n\t{\n\t\tpublic <marked>DemoResponse2()</marked> : base(\"/\")\n\t\t{\n\t\t\t// Parameterless Constructor will not be executed automatically anymore.\n\t\t}\n\n\t\t// ...\n\t}\n}");
            yield return new HText("Your application might also have some tasks that shall be executed whenever the application is started (e.g. deserializing / starting background tasks) or any tasks that shall be executed if the Assembly is unloaded - which happens if an executable is updated (e.g. stopping background tasks / serializing data). You can execute arbitrary public static methods on load and on unload using the Attributes LamestWebserver.Attributes.ExecuteOnLoad and LamestWebserver.Attributes.ExecuteOnUnload.");
            yield return CodeElement("using System;\n\nnamespace Demos\n{\n\tpublic static class Logic\n\t{\n\t\t[<marked>LamestWebserver.Attributes.ExecuteOnLoad</marked>] // Mark method as being called on load\n\t\tpublic <marked>static</marked> void DoSomething()\n\t\t{\n\t\t\t// Do something on load in a new thread.\n\t\t}\n\n\t\t[<marked>LamestWebserver.Attributes.ExecuteOnLoad(5, \"Hello World!\")</marked>,\n\t\t\t<marked>LamestWebserver.Attributes.ExecuteOnUnoad(1, \"Bye!\")</marked>]\n\t\t// Mark method as being called on load and called with the parameters 5 and \"Hello World\"\n\t\t//  and on unload with the parameters 1 and \"Bye!\"\n\n\t\tpublic <marked>static</marked> void DoSomethingElse(int count, string text)\n\t\t{\n\t\t\t// Do something else on load or unload in a new thread.\n\t\t\t\n\t\t\tfor(int i = 0; i < count; i++)\n\t\t\t\tConsole.WriteLine(text);\n\t\t}\n\n\n\t\t[<marked>LamestWebserver.Attributes.ExecuteOnUnload</marked>] // Mark method as being called on unload\n\t\tpublic <marked>static</marked> void DoSomethingOnUnload()\n\t\t{\n\t\t\t// Do something on unload in a new thread.\n\t\t}\n\t}\n}");
            yield return new HHeadline("How to configure the Host Service?", 2);
            yield return new HText("If the LamestWebserver Host Service has been properly installed (if not run lwshostsvc.exe --install) and has been run once the configuration file has been written to your Windows\\System32\\lwshost\\ folder to a file called 'lwsconfig.json'.");
            yield return new HText("You can edit this file before starting (or restarting) the service in order for the changes to be applied.");
            yield return new HText("The three most relevant options are BinaryDirectories, Ports and WebserverFileDirectory");
            yield return CodeElement("{\r\n\t<marked>\"BinaryDirectories\"</marked>: [\r\n\t\t\"C:\\\\Users\\\\Administrator\\\\Source\\\\Repos\\\\Project123\\\\Project123\\\\bin\\\\Release\"\r\n\t],\r\n\t<marked>\"Ports\"</marked>: [\r\n\t\t8080\r\n\t],\r\n\t<marked>\"WebserverFileDirectory\"</marked>: \"C:\\\\Users\\\\Administrator\\\\Source\\\\Repos\\\\Project123\\\\Project123\\\\bin\\\\Release\\\\web\",\r\n\t\"SessionIdRereferencingMode\": 0,\r\n\t\"SessionIdTransmissionType\": 1,\r\n\t\"MaxUserCount\": 256,\r\n\t\"UserHashMapSize\": 128,\r\n\t\"UserVariableStorageHashMapSize\": 512,\r\n\t\"PageResponseStorageHashMapSize\": 256,\r\n\t\"OneTimePageResponsesStorageQueueSize\": 4096,\r\n\t\"WebSocketResponsePageStorageHashMapSize\": 64,\r\n\t\"DirectoryResponseStorageHashMapSize\": 128,\r\n\t\"RequestMaxPacketSize\": 4096\r\n}");
            yield return new HHeadline("BinaryDirectories", 3);
            yield return new HText("BinaryDirectories is an array of paths to where the executables that shall be added are located at. You can specify multiple directories if you need to.");
            yield return new HHeadline("Ports", 3);
            yield return new HText("Ports is an array of ports at which the pages will be available at. You can specify multiple directories if you need to.");
            yield return new HHeadline("WebserverFileDirectory", 3);
            yield return new HText("WebserverFileDirectory is the directory at which the additional files for your webapplication or webservice are being located at (like images, javascript-files, stylesheets). These files can be referenced from anywhere in your code with just their name or their subdirectory and name if they are in a subdirectory.");
            yield return new HHeadline("SessionIdRereferencingMode", 3);
            yield return new HText("SessionIdRereferencingMode is a mode at which the clients are re-referenced. 0 means keeping the SessionId, 1 means always renewing the SessionID (not recommended!).");
            yield return new HHeadline("SessionIdTransmissionType", 3);
            yield return new HText("SessionIdTransmissionType is the mode at which the Server keeps track of the SessionIDs of the Users. 0 means via HTTP Post in every link or button etc. (deprecated and not recommended!), 1 means via Cookies which is nicer for the user to handle (no strange messages when navigating backwards).");
            yield return new HHeadline("MaxUserCount", 3);
            yield return new HText("MaxUserCount is the maximum amount of users allowed to be using your service at a given time. (only users that are logged in via SessionData count as users)");
            yield return new HHeadline("BinaryDirectories", 3);
            yield return new HText("BinaryDirectories is an array of paths to where the executables that shall be added are located at. You can specify multiple directories if you need to.");
            yield return new HHeadline("UserHashMapSize", 3);
            yield return new HText("UserHashMapSize is the size of the Hashmap that is internally used to access the users. This does not limit the amount of users being online - it's just a tool for you to preference performance or size.");
            yield return new HHeadline("UserVariableStorageHashMapSize", 3);
            yield return new HText("UserVariableStorageHashMapSize is the size of the UserVariableStorage Hashmap. This does not limit the amount of variables any user can hold at a given point - it's just a tool for you to preference performance or size.");
            yield return new HHeadline("PageResponseStorageHashMapSize", 3);
            yield return new HText("PageResponseStorageHashMapSize is the size of the Hashmap in the Servers for finding the PageResponse of a given URL. This does not limit the amount of pages the server can access - it's just a tool for you to preference performance or size.");
            yield return new HHeadline("OneTimePageResponsesStorageQueueSize", 3);
            yield return new HText("OneTimePageResponsesStorageQueueSize is the size of the Queue in the Servers for finding OneTimePageResponse of a given URL.");
            yield return new HHeadline("WebSocketResponsePageStorageHashMapSize", 3);
            yield return new HText("WebSocketResponsePageStorageHashMapSize is the size of the Hashmap in the Servers for finding the Websocket Response of a given URL. This does not limit the amount of websocket pages the server can access - it's just a tool for you to preference performance or size.");
            yield return new HHeadline("DirectoryResponseStorageHashMapSize", 3);
            yield return new HText("DirectoryResponseStorageHashMapSize is the size of the Hashmap in the Servers for finding the Directory Response of a given URL. This does not limit the amount of directory pages the server can access - it's just a tool for you to preference performance or size.");
            yield return new HHeadline("RequestMaxPacketSize", 3);
            yield return new HText("The amount of bytes read from the NetworkStream for every Request.");
        }

        public HElement CodeElement(string code)
        {
            var code_ = code.Split('\n');

            for (int j = 0; j < code_.Length; j++)
            {
                string line = code_[j];

                for (int i = 0; i < line.Length - 1; i++)
                {
                    if (line[i] == '/' && line[i + 1] == '/')
                    {
                        line = line.Insert(i, "<comment>");
                        line = line.Insert(line.Length, "</comment>");
                        break;
                    }
                }

                code_[j] = line;
            }

            code = "";

            foreach (string line in code_)
                code += line + "\n";

            return new HPlainText("<p class='code'>" + code.Replace("\n", "<br>").Replace("\t", "&nbsp;&nbsp;&nbsp;") + "</p>");
        }
    }
}
